# Algorithm B (Quick Linear search)
def algorithmB(R, K):

    i = 0  # Initialize
    R.append(K)
    N = len(R)

    for i in range(0, N):  # Increment

        if (R[i] == K):  # Compare
            if(i < N - 1):  # End?
                break
            else:
                break

# Algorithm C (Presort Linear search)
def algorithmC(R, K):

    i = 1  # Initialize
    N = len(R)

    for i in range(0, N):  # Increment

        if (K <= R[i]):  # Compare
            if(K == R[i]):  # End?
                break
            else:
                break


